INSERT INTO `tabArticle` VALUES ('565d1fed3a','2021-01-26 16:20:35.398839','2021-01-29 11:42:21.380647','Administrator','Administrator',0,NULL,NULL,NULL,0,'The Girl with all the Gifts','9780356500157','/files/thegirlwithallthegifts.jpeg','Available','<div>Melanie is a very special girl. Dr. Caldwell calls her \"our little genius.\"</div><div><br></div><div>Every morning, Melanie waits in her cell to be collected for class. When they come for her, Sergeant Parks keeps his gun pointing at her while two of his people strap her into the wheelchair. She thinks they don\'t like her. She jokes that she won\'t bite, but they don\'t laugh.</div><div><br></div><div>Melanie loves school. She loves learning about spelling and sums and the world outside the classroom and the children\'s cells. She tells her favorite teacher all the things she\'ll do when she grows up. Melanie doesn\'t know why this makes Miss Justineau look sad.</div><div><br></div><div><em>The Girl with All the Gifts</em> is a sensational thriller, perfect for fans of Stephen King, Justin Cronin, and Neil Gaiman.</div>',NULL,'M.R Carey',NULL,NULL,NULL,NULL,'Orbit','articles/565d1fed3a',1),('crooked-kingdom','2021-01-28 12:56:44.104847','2021-01-28 12:57:08.697135','Administrator','Administrator',0,NULL,NULL,NULL,0,'Crooked Kingdom ','B0117K9N3Q',NULL,'Available','<div>Welcome to the world of the Grisha.</div><div><br></div><div>Kaz Brekker and his crew of deadly outcasts have just pulled off a heist so daring even they didn\'t think they\'d survive. But instead of divvying up a fat reward, they\'re right back to fighting for their lives.</div><div><br></div><div>Double-crossed and badly weakened, the crew is low on resources, allies, and hope. As powerful forces from around the world descend on Ketterdam to root out the secrets of the dangerous drug known as jurda parem, old rivals and new enemies emerge to challenge Kaz\'s cunning and test the team\'s fragile loyalties.</div><div><br></div><div>A war will be waged on the city\'s dark and twisting streets - a battle for revenge and redemption that will decide the fate of the Grisha world.</div>',NULL,'Leigh Bardugo',NULL,NULL,NULL,NULL,'Orion Children\'s Books','article/crooked-kingdom',0),('seven-crows','2021-01-27 17:47:25.743372','2021-01-28 18:48:11.858990','Administrator','Administrator',0,NULL,NULL,NULL,0,'Seven Crows','B07NCY65CR','/files/seven_crows.jpeg','Available','<div><strong>An ex-con tracks down the men who have kidnapped her niece in this gritty and visceral thriller.</strong></div><div><br></div><div>Killian Delaney has a skewed moral compass, a high threshold for pain, and has just been released from prison to discover that someone has taken her niece.</div><div><br></div><div>Killian does not hesitate. Loyalty is the most important thing in her life, and when she gets a call from her sister saying that her daughter is missing, Killian immediately begins hunting down the men responsible.</div><div><br></div><div>She quickly discovers her niece was involved with a notorious biker gang who are engaged in everything from drugs to human trafficking. And to make it worse, the man who sent Killian to jail, the one she nearly beat to death, is at the center of it all.</div><div><br></div><div>To save her niece, she\'ll need a plan. A smart, quick, and efficient one. Because she\'s going to do it right this time. She\'ll burn them to the ground.</div>',NULL,'Kate Kessler',NULL,NULL,NULL,NULL,'Redhook','articles/seven-crows',1),('six-of-crows','2021-01-27 16:43:56.398596','2021-01-28 11:06:43.188200','Administrator','Administrator',0,NULL,NULL,NULL,0,'Six of Crows','1627792120','/files/sixofcrows.jpeg','Issued','<div>Ketterdam: a bustling hub of international trade where anything can be had for the right priceand no one knows that better than criminal prodigy Kaz Brekker. Kaz is offered a chance at a deadly heist that could make him rich beyond his wildest dreams. But he cant pull it off alone. . . .</div><div><br></div><div><em>A convict with a thirst for revenge</em></div><div><br></div><div><em>A sharpshooter who cant walk away from a wager</em></div><div><br></div><div><em>A runaway with a privileged past</em></div><div><br></div><div><em>A spy known as the Wraith</em></div><div><br></div><div><em>A Heartrender using her magic to survive the slums</em></div><div><br></div><div><em>A thief with a gift for unlikely escapes</em></div><div><br></div><div>Kazs crew is the only thing that might stand between the world and destructionif they dont kill each other first.</div>',NULL,' Leigh Bardugo',NULL,NULL,NULL,NULL,'Henry Holt & Company','articles/six-of-crows',1);
/*!40000 ALTER TABLE `tabArticle` ENABLE KEYS */;
UNLOCK TABLES;

