 \"<div><strong>An ex-con tracks down the men who have kidnapped her niece in this gritty and visceral thriller.</strong></div><div><br></div><div>Killian Delaney has a skewed moral compass, a high threshold for pain, and has just been released from prison to discover that someone has taken her niece.</div><div><br></div><div>Killian does not hesitate. Loyalty is the most important thing in her life, and when she gets a call from her sister saying that her daughter is missing, Killian immediately begins hunting down the men responsible.</div><div><br></div><div>She quickly discovers her niece was involved with a notorious biker gang who are engaged in everything from drugs to human trafficking. And to make it worse, the man who sent Killian to jail, the one she nearly beat to death, is at the center of it all.</div><div><br></div><div>To save her niece, she\'ll need a plan. A smart, quick, and efficient one. Because she\'s going to do it right this time. She\'ll burn them to the ground.</div>\"\n  ]\n ],\n \"data_import\": null,\n \"removed\": [],\n \"row_changed\": []\n}','seven-crows','Article',NULL,NULL,NULL,NULL),('9288144f9e','2021-01-28 09:10:06.163416','2021-01-28 09:10:06.163416','Administrator','Administrator',0,NULL,NULL,NULL,0,'{\n \"added\": [],\n \"changed\": [\n  [\n   \"enable_two_factor_auth\",\n   0,\n   1\n  ]\n ],\n \"data_import\": null,\n \"removed\": [],\n \"row_changed\": []\n}','System Settings','System Settings',NULL,NULL,NULL,NULL),('934af28ac4','2021-01-28 09:09:10.045241','2021-01-28 09:09:10.045241','Administrator','Administrator',0,NULL,NULL,NULL,0,'{\n \"added\": [],\n \"changed\": [\n  [\n   \"enabled\",\n   0,\n   null\n  ],\n  [\n   \"send_welcome_email\",\n   0,\n   null\n  ],\n  [\n   \"unsubscribed\",\n   0,\n   null\n  ],\n  [\n   \"mute_sounds\",\n   0,\n   null\n  ],\n  [\n   \"logout_all_sessions\",\n   0,\n   null\n  ],\n  [\n   \"document_follow_notify\",\n   0,\n   null\n  ],\n  [\n   \"thread_notify\",\n   0,\n   null\n  